eral statement');Db($doc.getElementById('gen_statement_text'),'The In-MINDD team fully respects your right to privacy, and will not collect any personal information about you on this website without your clear permission. Any personal information which you volunteer to the In-MINDD research team will be treated with the highest standards of security and confidentiality, strictly in accordance with Data Protection legislation.');Db($doc.getElementById('collect_statement'),'Collection and use of personal information');Db($doc.getElementById('collect_statement_text'),'The In-MINDD research team does not collect any personal data about you on this website, apart from information which you volunteer (for example, by completing the online In-MINDD profiler). Any information that you provide in this way is not made available to any third parties, and is used by the In-MINDD research team only in line with the purpose for which you provided it. Any personal data that you provide will be anonymised and may be be used for statistical purposes.<br/>Certain pages on this site provide an option to ask questions by email, or to submit a comment. This information will only be recorded if you choose to send us a message and will only be used for the purpose for which you have provided it.');Db($doc.getElementById('request_stat'),'Requests regarding data supplied via this website');Db($doc.getElementById('request_statement_text'),'On request, we can supply copies of your personal data which you may have supplied via this website. If you wish to obtain such copies, you must contact the In-MINDD research team (see contact details below). <br/>In certain circumstances you may request that data which you have supplied via the website be deleted. If you wish to request a deletion, you would generally be expected to identify some contravention of data protection law in the manner in which the In-MINDD research team processes the data concerned.');Db($doc.getElementById('complaints'),'Complaints about data processed via the website.');Db($doc.getElementById('complaints_text'),'If you are concerned about how personal data are processed via this website, please do not hesitate to bring such concerns to the attention of the In-MINDD research team (see contact details below).');Db($doc.getElementById('collection_tech'),'Collection and use of technical information');Db($doc.getElementById('collection_tech_text'),'When someone visits the In-MINDD trial website we collect standard internet log information and details of visitor behaviour patterns.  The In-MINDD trial website uses cookies. Cookies are small text files held on your computer. Cookies will never contain any personally identifiable information.<br/>We use these cookies to gather and monitor statistics such as, for example:');Db($doc.getElementById('tech_stat_1'),'If you create an account with us then we will use cookies for the management of the signup process and general administration. These cookies will usually be deleted when you log out however in some cases they may remain afterwards to remember your site preferences when logged out.');Db($doc.getElementById('tech_stat_2'),'We use cookies when you are logged in so that we can remember this fact. This prevents you from having to log in every single time you visit a new page. These cookies are typically removed or cleared when you log out to ensure that you can only access restricted features and areas when logged in.');Db($doc.getElementById('tech_stat_3'),'In order to provide you with a great experience on this site we provide the functionality to set your preferences for how this site runs when you use it. In order to remember your preferences we need to set cookies so that this information can be called whenever you interact with a page is affected by your preferences.<br/>In some special cases we also use cookies provided by trusted third parties. The following section details which third party cookies you might encounter through this s
